  const handlelogin = () =>{
      let user = {
          email: email,
          password: password
      }
      console.log(user)
  }

  return (
    <div>
        <input onChange={ () => setEmail(e.target.value) } name="email" type="text"/>
        <input onChange={ () => setPassword(e.target.value) } name="password" type="text"/>
        <button onClick={handlelogin}></button>
    </div>
  )
}
